import logging

log = logging.getLogger(__name__)
log.info(f'Logger started for {__name__}')

loading_linear = b''


def loading(style='linear_modern'):

    if style == 'linear_modern':
        animation = loading_linear

    import PySimpleGUI as sg
    for i in range(47000):
        sg.popup_animated(animation, background_color='#DB4F4F',
                          time_between_frames=100)

    sg.popup_animated(None)
